  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend
} from "chart.js";

ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend
);



const dashboard: React.FC = () => {
  return (
    <MainLayout>
    <div>
      <h1>dashboard Page</h1>
      <p>Welcome to the dashboard.</p>
      <div className='date-div'>
            <label className='lavel'>日付：</label>
                <input id='date' className='select-kind' type="date" />
        </div>
    </div>
    </MainLayout>
  );
};

export default dashboard;
